 inc(prod: any){
  //  console.log(prod.qnt);
  if(prod.qnt != 5){
    prod.qnt += 1;
  }
  
 }
 dec(prod: any){
  // console.log(prod);
  if(prod.qnt != 1){
    prod.qnt -= 1;
  }
}
itemsCart:any = [];
addCart(category:any){
  
//  console.log(category);
 let cartDataNull = localStorage.getItem('localCart');

 if(cartDataNull == null){
   let storeDataGet:any = [];
   storeDataGet.push(category);
   localStorage.setItem('localCart', JSON.stringify(storeDataGet));
 }
 else{
   var id = category.prodId;
   let index:number = -1;
   this.itemsCart = localStorage.getItem('localCart');
   this.itemsCart = JSON.parse(this.itemsCart);
   for(let i=0; i<this.itemsCart.length; i++){
     if(parseInt(id) === parseInt(this.itemsCart[i].prodId)){
       this.itemsCart[i].qnt = category.qnt;
       index = i;
       break;
     }
   }
   if(index == -1){
     this.itemsCart.push(category);
     localStorage.setItem('localCart', JSON.stringify(this.itemsCart));
   }
   else{
    localStorage.setItem('localCart', JSON.stringify(this.itemsCart));
   }
 }
 this.cartNumberFunc();

}
cartNumber:number = 0;
cartNumberFunc(){
  this.cartValue = localStorage.getItem('localCart');
  this.cartValue = JSON.parse(this.cartValue);
this.cartNumber = this.cartValue.length;
this.auth.cartSubject.next(this.cartNumber);

}
